import { DataProvider } from './GlobalState';
import React from 'react';
import { Router } from 'express';
import Header from './components/headers/Header'
import MainPages from './components/mainpages/Pages'
function App() {
  return (
    <DataProvider>
    <Router>
    <div className="App">
      <Header/>
      <MainPages/>
    </div>
    </Router>
    </DataProvider>
  );
}

export default App;
